import React, { useState } from 'react';

import AddingForm from './components/AddingForm';
import ShowResults from './components/ShowResults';

function App() {
	const [checked, setChecked] = useState(false);

	const changeCheck = () => {
		setChecked(!checked);
	};
	const results = {
		distanse: 0,
		year: 0,
		date_start: new Date(),
		date_end: new Date(),
	};

	return checked === false ? (
		<div>
			<AddingForm Change={changeCheck} />
		</div>
	) : (
		<div>
			<ShowResults Change={changeCheck} />
		</div>
	);
}

export default App;
